    int PoseClassifier::call(const NormalizedLandmarkList& landmarks) {
        std::vector<std::vector<float>> pose_embedding = _pose_embedder.call(landmarks);
        std::vector<std::vector<float>> flipped_pose_embedding;
        for (std::vector<float> pose: pose_embedding) {
            std::vector<float> flipped_pose;
            flipped_pose.push_back(-pose[0]);
            flipped_pose.push_back(pose[1]);
            flipped_pose.push_back(pose[2]);
            flipped_pose_embedding.push_back(flipped_pose);
        }

        std::vector<std::vector<float>> _axes_weights = {{1.0, 1.0, 0.2}};
        std::vector<std::pair<float,int>> max_dist_heap;
        if (pose_embedding.size() != pose_sample[0]->embedding.size()) {
            return 0;
        }
        for (int sample_idx = 0; sample_idx < pose_sample.size(); sample_idx++) {
            PoseSample* sample = pose_sample[sample_idx];
            float max_distance = 0;
            float flipped_max_distance = 0;
            for (int i = 0; i < sample->embedding.size(); i++) {
                for (int j = 0; j < sample->embedding[i].size() ; j++) {
                    if (std::abs(sample->embedding[i][j] - pose_embedding[i][j]) * _axes_weights[0][j] > max_distance) {
                        max_distance = std::abs(sample->embedding[i][j] - pose_embedding[i][j]) * _axes_weights[0][j];
                    }
                    if (std::abs(sample->embedding[i][j] - flipped_pose_embedding[i][j]) * _axes_weights[0][j] > flipped_max_distance) {
                        flipped_max_distance = std::abs(sample->embedding[i][j] - flipped_pose_embedding[i][j]) * _axes_weights[0][j];
                    }
                }
            }
            max_distance = std::min(max_distance, flipped_max_distance);
            max_dist_heap.push_back({max_distance, sample_idx});
        }
        std::sort(max_dist_heap.begin(), max_dist_heap.end());

        max_dist_heap.resize(_top_n_by_max_distance);

        std::vector<std::pair<float,int>> mean_dist_heap;
        for (int index = 0; index < max_dist_heap.size() ; index++) {
            PoseSample* sample = pose_sample[max_dist_heap[index].second];
            float avg_distance = 0;
            float flipped_avg_distance = 0;
            for (int i = 0; i < sample->embedding.size(); i++) {
                for (int j = 0; j < 3 ; j++) {
                    avg_distance += std::abs(sample->embedding[i][j] - pose_embedding[i][j]) * _axes_weights[0][j];
                    flipped_avg_distance += std::abs(sample->embedding[i][j] - flipped_pose_embedding[i][j]) * _axes_weights[0][j];
                }
            }
            avg_distance = std::min(avg_distance, flipped_avg_distance);
            mean_dist_heap.push_back({avg_distance, max_dist_heap[index].second});
        }
        std::sort(mean_dist_heap.begin(), mean_dist_heap.end());
        mean_dist_heap.resize(_top_n_by_mean_distance);
        int cntPlank= 0;
        int cntWarrior = 0;
        for (auto i : mean_dist_heap) {
            if (pose_sample[i.second]->class_name == "Plank") {
                cntPlank++;
            }
            else {
                cntWarrior++;
            }
        }
        if (cntWarrior > cntPlank) {
            return cntWarrior*100;
        }
        else {
            return cntPlank;
        }
    }
